import React, { useState } from "react";
import { useNavigate } from "react-router-dom";

// Images
import logo from "../assets/logo.jpg";
import necklace1 from "../assets/bridal-set1.jpg";
import necklace2 from "../assets/bridal-set2.jpg";
import necklace3 from "../assets/bridal-set3.jpg";

const BridalNecklace = () => {
  const navigate = useNavigate();
  const [search, setSearch] = useState("");

  const necklaces = [
    { 
      name: "Elegant Pearl Necklace", 
      img: necklace1,
      desc: "A timeless pearl necklace perfect for your wedding day." 
    },
    { 
      name: "Golden Bridal Necklace", 
      img: necklace2,
      desc: "Luxurious gold design with intricate craftsmanship." 
    },
    { 
      name: "Diamond Studded Necklace", 
      img: necklace3,
      desc: "Sparkling diamonds to add elegance to your bridal look." 
    },
  ];

  const filtered = necklaces.filter((item) =>
    item.name.toLowerCase().includes(search.toLowerCase())
  );

  // Button handlers
  const handleBuyNow = (name) => alert(`Buy Now clicked for ${name}`);
  const handleAddToCart = (name) => alert(`Added ${name} to Cart`);
  const handleWishlist = (name) => alert(`Added ${name} to Wishlist`);

  return (
    <div className="home-container">
      {/* Header */}
      <header className="navbar">
        <div className="logo">
          <img src={logo} alt="Elegant Jewelry Logo" className="logo-img" />
          <span className="brand-name">Elegant Jewelry</span>
        </div>
        <ul className="nav-links">
          <li><a href="/">Home</a></li>
          <li><a href="/about">About</a></li>
          <li><a href="/collections">Collections</a></li>
          <li><a href="/orders">Orders</a></li>
          <li><a href="/wishlist">Wishlist</a></li>
          <li><a href="/contact">Contact</a></li>
        </ul>
      </header>

      {/* Search Bar */}
      <div className="search-bar" style={{ textAlign: "center", margin: "40px 0 20px 0" }}>
        <input
          type="text"
          placeholder="Search Necklace..."
          value={search}
          onChange={(e) => setSearch(e.target.value)}
          style={{
            padding: "10px 20px",
            borderRadius: "25px",
            border: "2px solid #d6336c",
            width: "260px",
            outline: "none",
            fontSize: "15px",
          }}
        />
        <button
          style={{
            marginLeft: "10px",
            padding: "10px 25px",
            borderRadius: "25px",
            border: "none",
            backgroundColor: "#d6336c",
            color: "white",
            fontWeight: "500",
            cursor: "pointer",
          }}
        >
          Search
        </button>
      </div>

      {/* Necklace Section */}
      <section className="collections-section">
        <h2 className="collections-title">Bridal Necklaces</h2>
        <div className="collections-grid" style={{ display: "flex", justifyContent: "center", gap: "30px", flexWrap: "wrap" }}>
          {filtered.map((item, index) => (
            <div key={index} className="collection-card" style={{ width: "250px", textAlign: "center" }}>
              <img src={item.img} alt={item.name} style={{ width: "100%", height: "250px", objectFit: "cover", borderRadius: "10px" }} />
              <div className="card-panel">
                <h3 className="collection-name" style={{ color: "#d6336c", marginTop: "10px" }}>{item.name}</h3>
                <p className="collection-desc" style={{ fontStyle: "italic", color: "#a8326f", margin: "8px 0 15px 0", lineHeight: "1.4" }}>{item.desc}</p>

                {/* Buttons Row */}
                <div style={{ display: "flex", justifyContent: "space-between", marginBottom: "10px" }}>
                  <button
                    onClick={() => handleBuyNow(item.name)}
                    style={{ backgroundColor: "#d6336c", color: "white", border: "none", padding: "6px 12px", borderRadius: "20px", cursor: "pointer" }}
                  >
                    Buy Now
                  </button>
                  <button
                    onClick={() => handleAddToCart(item.name)}
                    style={{ backgroundColor: "#d6336c", color: "white", border: "none", padding: "6px 12px", borderRadius: "20px", cursor: "pointer" }}
                  >
                    Add to Cart
                  </button>
                </div>

                <button
                  onClick={() => handleWishlist(item.name)}
                  style={{ backgroundColor: "#d6336c", color: "white", border: "none", padding: "6px 12px", borderRadius: "20px", cursor: "pointer" }}
                >
                  Wishlist
                </button>
              </div>
            </div>
          ))}
        </div>
      </section>

      {/* Footer */}
      <footer style={{ backgroundColor: "#000", color: "#fff", padding: "30px 0", textAlign: "center", marginTop: "50px" }}>
        <p>Â© 2025 Elegant Jewelry. All Rights Reserved.</p>
      </footer>
    </div>
  );
};

export default BridalNecklace;
